<table>
    <tr>
        <th>id</th>
        <th>username</th>
        <th>role</th>
        <th>name</th>
        <th>date register</th>
    </tr>
    {% for object in objects %}
    <tr>
        <td>{{ object.id }}</td>
        <td>{{ object.username }}</td>
        <td>{{ object.role }}</td>
        <td>{{ object.full_name }}</td>
        <td>{{ object.created_at }}</td>
    </tr>
    {% endfor %}
</table>
